import React from 'react'
import * as S from './style'
import {  Link,useNavigate } from 'react-router-dom';
import {useSelector } from 'react-redux';

function Naver() {
 
  const navigate = useNavigate();
  const {userDetails,login ,success} = useSelector(state => state.user);
  const handleClick = () => {
    navigate('/'); 
    window.location.replace("/")
  };

  return (
    <S.Component>
    <div className='body'>
    
   <Link to={'/'} onClick={handleClick} ><div    className='Home_button'>Hangjj-gamble</div></Link>
   
   
    <div className='List'>
      <div>사다리</div>
      <div>그래프</div>
      <div>룰렛</div>       
      <Link to={'/login'}>{login && success === true ?  <div className='login'>{userDetails.name}</div>:<div className='login'>Login</div>}</Link>
      </div>
    </div>
    </S.Component>
  )
}

export default Naver
